export default function About(){

    return (
        <div className="about">
            <h1>About</h1>
            <p>
                This is a web application that allows you to search for and compare the stats of two different robots.
                You can search for a robot by its name, or you can search for a robot by its ID.
                You can also compare the stats of two robots by their ID.
            </p>
        </div>

    )
}
